import{_ as e,o as t,c as o,f as r}from"./app.1ded8a6d.js";const a={},s=r('<h1 id="troubleshooting" tabindex="-1"><a class="header-anchor" href="#troubleshooting" aria-hidden="true">#</a> Troubleshooting</h1><p>If you get redirected to a page that says “Sorry, an error occurred”, please look at the url. It contains an ‘error description’ parameter. Sometimes, the error can’t be solved by you. The two most common cases are</p><ul><li><strong>Callback URL mismatch. example.com/callback is not in the list of allowed callback URLs:</strong> Contact <a href="it@bcc.no?subject=Support%Developer%BCC">support</a> and ask them to add the specified callback URL to your client.</li><li><strong>Grant type ‘authorization_code’ not allowed for the client:</strong> Contact <a href="it@bcc.no?subject=Support%Developer%BCC">support</a> and ask them to allow the specified grant type for your client.&#39;</li></ul><p>If you get the error: “Failed user creation” when logging in with OpenID Connect, you most likely have an existing WordPress user with the same email address as your BCC user, but with a username that is not your BCC person ID. In that case, either change the email address of the existing WordPress user or remove the WordPress user. After that you should no longer get the error.</p><hr><p>Next: <a href="index">Home</a></p>',6),n=[s];function i(c,l){return t(),o("div",null,n)}const u=e(a,[["render",i],["__file","troubleshooting.html.vue"]]);export{u as default};
